import { type } from 'os';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';

export interface iShema{
    name: 'dark'|'dark1'| 'dark2'|'light'| 'def';
} 
type tMenu = {
    name:string
    linkComp:string
}

const listMenu: tMenu[] = [
    {name:'#hmome',linkComp:'Home'},
    {name:'#features',linkComp:'Features'},
    {name:'#pricing',linkComp:'Pricing'},
];


const App = () => {
    return listMenu.map(item => {
      return (
        <Nav.Link href="#home">item.linkComp</Nav.Link>
      )
    })
  };

function ColorSchemesExample(props:iShema) {

    listMenu1 : [
        {name:'#hmome',linkComp:'Home'},
        {name:'#features',linkComp:'Features'},
        {name:'#pricing',linkComp:'Pricing'},
    ];

    stations : [
        {call:'station one',frequency:'000'},
        {call:'station two',frequency:'001'}
      ];

    const testName:string = 'Home';



    const project = () => {
        switch(props.name) {
          case 'dark': return(
                <Navbar bg="dark" data-bs-theme="dark">
                <Container>
                <Navbar.Brand href="#home">Navbar</Navbar.Brand>
                <Nav className="me-auto">
                <App/>
                {/* <Nav.Link href="#home">Home</Nav.Link>
                <Nav.Link href="#features">Features</Nav.Link>
                <Nav.Link href="#pricing">Pricing</Nav.Link> */}
                </Nav>
                </Container>
                </Navbar>
          );
          case 'dark1':   return( 
                <Navbar bg="dark" data-bs-theme="dark">
                <Container>
                <Navbar.Brand href="#home">Navbar</Navbar.Brand>
                <Nav className="me-auto">
                <Nav.Link href="#home">Home</Nav.Link>
                <Nav.Link href="#features">Features</Nav.Link>
                <Nav.Link href="#pricing">Pricing</Nav.Link>
                </Nav>
                </Container>
                </Navbar>
            );
            case 'dark2':   return( 
                <Navbar bg="primary" data-bs-theme="dark">
                <Container>
                <Navbar.Brand href="#home">Navbar</Navbar.Brand>
                <Nav className="me-auto">
                <Nav.Link href="#home">Home</Nav.Link>
                <Nav.Link href="#features">Features</Nav.Link>
                <Nav.Link href="#pricing">Pricing</Nav.Link>
                </Nav>
                </Container>
                </Navbar>);
            case 'light':   return(
                <Navbar bg="light" data-bs-theme="light">
                <Container>
                <Navbar.Brand href="#home">Navbar</Navbar.Brand>
                <Nav className="me-auto">
                <Nav.Link href="#home">Home</Nav.Link>
                <Nav.Link href="#features">Features</Nav.Link>
                <Nav.Link href="#pricing">Pricing</Nav.Link>
                </Nav>
                </Container>
                </Navbar>);
          default:      return <h1>No project match</h1>
        }
      }
  return (
    <>
        <div>{ project() }</div>
        {props.name}
    </>
  );
}

export default ColorSchemesExample;
